import {Route,Switch} from 'react-router-dom'
import AllMeetUpsPage from "./pages/AllMeetUps";
import NewMeetUpsPage from "./pages/NewMeetIp";
import FavoriteMeetUpsPage from "./pages/Favorites";
import MainNavigation from './componants/layout/MainNavigation'
function App() {
  return <div>
    <MainNavigation />
    <Switch>
      <Route path='/' exact>
        <AllMeetUpsPage />
      </Route>
      <Route path='/favorite'>
        <FavoriteMeetUpsPage />
      </Route>
      <Route path='/new'>
        <NewMeetUpsPage />
      </Route>
      </Switch>
  </div>;
}

export default App;
